import React from "react";
import fb from '../../../Assets/Images/Logo/facebook.svg';
import styles from './SocialLinks.module.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faFacebook, faYoutube, faInstagram, faTwitter } from '@fortawesome/free-brands-svg-icons'



const socialLinks = () => (
    <div className={styles.Main}>
        <h2>Phone Clinic</h2>
        <p>Here some useful links</p>
        <ul>
            <li><a href=''><FontAwesomeIcon style={{height: '60px', width: '80px'}} icon={faFacebook}/></a></li>
            <li><a href=''><FontAwesomeIcon icon={faYoutube}/></a></li>
            <li><a href=''><FontAwesomeIcon icon={faInstagram}/></a></li>
            <li><a href=''><FontAwesomeIcon icon={faTwitter}/></a></li>
        </ul>
        <FontAwesomeIcon icon={"youtube"}/>
    </div>
)

export default socialLinks;
